import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export default function SuperUserData() {
  const navigate = useNavigate();
  const [userData, setUserData] = useState({
    userData: "",
  });

  const logout = () => {
    window.localStorage.clear();
    window.location.href = "/superUser/login";
  };

  useEffect(() => {
    // Check for super user authentication
    const superUserAuthenticated = window.localStorage.getItem("superUserAuthenticated");
    if (!superUserAuthenticated) {
      // If not authenticated, redirect to the login page
      navigate("/superUser/login");
      return;
    }

    // Fetch super user data here (similar to how user data is fetched in UserHome)
    // You need to send a request to retrieve super user data using a token.

    // Replace the below code with your actual data fetching logic.
    // Example:
    const token = window.localStorage.getItem("superUserToken");
    if (token) {
      fetch("http://localhost:5000/getSuperUserData", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
        },
        body: JSON.stringify({
          token,
        }),
      })
        .then((res) => res.json())
        .then((data) => {
          if (data.status === "ok") {
            setUserData({
              userData: data.data,
            });
          }
        })
        .catch((error) => {
          console.error("Error fetching super user data:", error);
        });
    }
    // End of data fetching logic.
  }, []);

  return (
    <div>
      <div>
        {/* Render super user data similar to UserHome component */}
        <p>Name</p>
        <h4>{userData.userData.fname} {userData.userData.lname}</h4>
      </div>
      <div>
        <p>Email</p>
        <h4>{userData.userData.email}</h4>
      </div>
      <br />
      <button className="btn btn-primary" onClick={logout}>
        Logout
      </button>
    </div>
  );
}
